import './App.css';
import { Autocomplete }  from "@mui/lab";
import TextField from "@mui/material/TextField";
const movies = [
    {title: 'Mean Girls'},
    {title: 'Hackers'},
    {title: 'The Grey'},
    {title: 'Sunshine'},
      {title: 'Ex Machina'},
      ];

function App() {
  return (
    <div className="App">
        <>
          {/* {movies.map((movie, index) => (
          <p key={index}>{movie.title}</p>))
          } */}
				<Autocomplete disablePortal id="combo-box-demo" options={movies.map((option) => option.title)}
        sx={{ width: 300 }}
        renderInput={(params) => <TextField {...params} label="Movie" />}
        />
        </> 
    </div>
  );
}

export default App;
